function prepare_building() {
  mkdir $GITHUB_WORKSPACE/aosp
  cd $GITHUB_WORKSPACE/aosp

  mkdir -p out && echo '1735664461' > out/build_date.txt
  mkdir -p out/soong/ && echo userdebug.buildbot.20240101.000000 > out/soong/build_number.txt
  mkdir -p out/soong/.minibootstrap && ln -sf $GITHUB_WORKSPACE/bpglob out/soong/.minibootstrap/bpglob

  ln -sf $GITHUB_WORKSPACE/kati kati

  mkdir -p prebuilts/ && ln -sf $GITHUB_WORKSPACE/prebuilts/build-tools prebuilts/
  mkdir -p prebuilts/clang/host/ && ln -sf $GITHUB_WORKSPACE/prebuilts/clang/host/linux-x86 prebuilts/clang/host/
}
function rsync_image_dirs() {
  image_dirs=("odm" "odm_dlkm" "product" "root" "system" "system_ext" "system_other" "vendor" "vendor_dlkm")
  for image_dir in "${image_dirs[@]}"; do
    if [ -d "out/target/product/vsoc_x86_64/$image_dir" ]; then
      rsync -a -r "out/target/product/vsoc_x86_64/$image_dir" "$GITHUB_WORKSPACE/images/"
    fi
  done
}


